uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

uniform float u_speed;
uniform float u_complexity;
uniform float u_warp;
uniform float u_bloom;
uniform float u_filament_sharpness;
uniform float u_color_shift;
uniform float u_grid_opacity;

out vec4 fragColor;

// --- UTILS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// 2D Hash
vec2 hash(vec2 p) {
    p = vec2(dot(p, vec2(127.1, 311.7)), dot(p, vec2(269.5, 183.3)));
    return -1.0 + 2.0 * fract(sin(p) * 43758.5453123);
}

// Gradient Noise
float noise(vec2 p) {
    vec2 i = floor(p);
    vec2 f = fract(p);
    vec2 u = f * f * (3.0 - 2.0 * f);
    return mix(mix(dot(hash(i + vec2(0.0, 0.0)), f - vec2(0.0, 0.0)),
                   dot(hash(i + vec2(1.0, 0.0)), f - vec2(1.0, 0.0)), u.x),
               mix(dot(hash(i + vec2(0.0, 1.0)), f - vec2(0.0, 1.0)),
                   dot(hash(i + vec2(1.0, 1.0)), f - vec2(1.0, 1.0)), u.x), u.y);
}

// Fractal Brownian Motion (fBm)
float fbm(vec2 p) {
    float v = 0.0;
    float a = 0.5;
    mat2 m = rot(0.37);
    for (int i = 0; i < 6; i++) {
        v += a * noise(p);
        p = m * p * 2.02;
        a *= 0.5;
    }
    return v;
}

// Ridged Multifractal Noise for filaments
float ridge(float h) {
    h = abs(h);
    h = 1.0 - h;
    return h * h;
}

float ridgedFbm(vec2 p) {
    float v = 0.0;
    float a = 0.5;
    float freq = 1.0;
    for (int i = 0; i < 5; i++) {
        v += ridge(noise(p * freq)) * a;
        freq *= 2.1;
        a *= 0.45;
    }
    return v;
}

// Palette function
vec3 palette(float t) {
    t += u_color_shift * 0.1;
    vec3 a = vec3(0.05, 0.05, 0.1);
    vec3 b = vec3(0.2, 0.5, 0.8); // Blue
    vec3 c = vec3(0.8, 0.4, 0.1); // Orange
    vec3 d = vec3(1.0, 0.9, 0.2); // Gold

    if (t < 0.3) return mix(a, b, t / 0.3);
    if (t < 0.7) return mix(b, c, (t - 0.3) / 0.4);
    return mix(c, d, (t - 0.7) / 0.3);
}

void main() {
    // Correct Aspect Ratio UVs
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float t = iTime * u_speed;

    // Initial Symmetry (Neural Quad-Symmetry)
    vec2 suv = abs(uv);

    // Background Radial Darkening
    float dist = length(uv);
    vec3 col = vec3(0.02, 0.03, 0.06) * (1.0 - smoothstep(0.0, 1.5, dist));

    // Digital Grid
    vec2 grid_uv = fract(uv * 15.0);
    float grid = smoothstep(0.97, 1.0, max(grid_uv.x, grid_uv.y));
    col += grid * u_grid_opacity * vec3(0.4, 0.6, 1.0);

    // Domain Warping Process
    // Offset uv for swirling motion
    vec2 p = uv * u_complexity;
    p += rot(t * 0.2) * p; // Rotation over time

    // Layer 1: Base Flow (Cyan/Blue)
    vec2 q = vec2(fbm(p + vec2(0.0)), fbm(p + vec2(5.2, 1.3)));
    vec2 r = vec2(fbm(p + 4.0 * q + vec2(1.7, 9.2) + t * 0.15), 
                  fbm(p + 4.0 * q + vec2(8.3, 2.8) + t * 0.12));

    float f = fbm(p + 4.0 * r * u_warp);

    // Colors for the Flow
    vec3 flowCol = palette(clamp(f * 1.2 + r.y * 0.5, 0.0, 1.0));
    col = mix(col, flowCol, smoothstep(0.0, 1.0, f + 0.2));

    // Layer 2: Glowing Filaments (Orange/Gold)
    // We use the ridged noise for sharp "lightning" structures
    float filaments = ridgedFbm(uv * (u_complexity * 1.5) + r * 2.0 - t * 0.3);
    filaments = pow(filaments, u_filament_sharpness);

    vec3 filamentCol = vec3(1.0, 0.6, 0.2) * filaments * 3.0;
    filamentCol += vec3(1.0, 0.9, 0.5) * pow(filaments, 2.0) * 2.0;

    // Mask filaments by the underlying symmetry to create "X" shape core
    float diagonalMask = smoothstep(0.1, 0.0, abs(suv.x - suv.y) - 0.1);
    col += filamentCol * u_bloom * (0.5 + 0.5 * diagonalMask);

    // High energy pulses
    float pulse = sin(t * 2.0 - length(uv) * 4.0) * 0.5 + 0.5;
    col += filamentCol * pulse * 0.5;

    // Subtle Film Grain
    float grain = fract(sin(dot(uv, vec2(12.9898, 78.233))) * 43758.5453);
    col += (grain - 0.5) * 0.04;

    // Contrast and Vignette
    col = pow(col, vec3(0.95)); // Slight gamma adjustment
    col *= smoothstep(1.5, 0.4, dist); // Stronger vignette

    // Final output with alpha
    fragColor = vec4(col, 1.0);
}
